import React, { Component } from 'react';
import './RightVerticalMenu.scss';

const leftVerticalMenu = () => (
  <nav className="right-vertical-menu">
    <ul>
      <li>
        <a href="https://grindreel.com/" target="_blank" rel="noopener noreferrer">
          Follow The GRIP Movement
        </a>
      </li>
    </ul>
  </nav>
);

export default leftVerticalMenu;
